import "./ExpenseForm.css";

const ExpenseForm = () => {
  return (
    <form className="new-expense__controls">
      <div className="new-expense__control">
        <label>Title</label>
        <input type="text" />
      </div>
      <div className="new-expense__control">
        <label>Amount</label>
        <input type="number" min="0.01" step="0.01" />
      </div>
      <div className="new-expense__control">
        <label>Title</label>
        <input type="date" min="2019-01-01" max="2023-12-31" />
      </div>
    </form>
  );
};
export default ExpenseForm;
